import React, { useState } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../../contexts/AuthContext';
import ActionButton from '../../components/ui/ActionButton';

const Login: React.FC = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState<string | null>(null);
  const [isLoading, setIsLoading] = useState(false);

  const { signIn } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();

  const from = (location.state as any)?.from?.pathname || '/dashboard';

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setError(null);
    setIsLoading(true);

    try {
      // Simulamos la autenticación para propósitos de desarrollo
      setTimeout(() => {
        // Credenciales de ejemplo para desarrollo
        if (email === 'admin@fincentiva.com' && password === 'admin123') {
          // Simulamos un usuario autenticado
          const mockUser = {
            id: '1',
            email: 'admin@fincentiva.com',
            name: 'Admin',
            role: 'SUPERADMIN'
          };

          // Actualizar el estado del contexto de autenticación
          if (signIn) {
            signIn(email, password)
              .then(() => {
                navigate(from, { replace: true });
              })
              .catch(err => {
                console.error('Error en signIn:', err);
                setError('Error al procesar la autenticación');
                setIsLoading(false);
              });
          } else {
            // Si no hay función signIn disponible, simular navegación directa
            console.log('Mock user authenticated:', mockUser);
            navigate('/dashboard', { replace: true });
            setIsLoading(false);
          }
        } else {
          setError('Credenciales inválidas');
          setIsLoading(false);
        }
      }, 1000); // Simulamos un retraso de red
    } catch (err) {
      setError('Error al iniciar sesión');
      console.error(err);
      setIsLoading(false);
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-base-200">
      <div className="card flex-shrink-0 w-full max-w-sm shadow-2xl bg-base-100">
        <div className="card-body">
          <div className="text-center mb-4">
            <h1 className="text-4xl font-bold text-primary">Fincentiva</h1>
            <p className="text-sm opacity-70 mt-1">CRM</p>
          </div>

          <form onSubmit={handleSubmit}>
            {error && (
              <div className="alert alert-error mb-4">
                <svg xmlns="http://www.w3.org/2000/svg" className="stroke-current shrink-0 h-6 w-6" fill="none" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M10 14l2-2m0 0l2-2m-2 2l-2-2m2 2l2 2m7-2a9 9 0 11-18 0 9 9 0 0118 0z" /></svg>
                <span>{error}</span>
              </div>
            )}

            <div className="form-control">
              <label className="label">
                <span className="label-text">Correo electrónico</span>
              </label>
              <input
                type="email"
                placeholder="correo@ejemplo.com"
                className="input input-bordered"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
              />
            </div>

            <div className="form-control">
              <label className="label">
                <span className="label-text">Contraseña</span>
              </label>
              <input
                type="password"
                placeholder="••••••••"
                className="input input-bordered"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
              />
              <label className="label">
                <button type="button" className="label-text-alt link link-hover">¿Olvidaste tu contraseña?</button>
              </label>
            </div>

            <div className="form-control mt-6">
              <ActionButton 
                type="submit" 
                variant="primary" 
                isLoading={isLoading}
                className="w-full"
              >
                Iniciar Sesión
              </ActionButton>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Login;
